if mibBuilder.loadTexts: syupsBasicSignalDefinition.setDescription('The signal definitions for the basic signaling UPS. The value can be the following bit combinations: SG_POWER_FAILURE_ENABLE 0x01 SG_BATTERY_LOW_ENABLE 0x02 SG_SHUTDOWN_ENABLE 0x04 SG_POWER_FAILURE_VOLTHIGH 0x10 SG_BATTERY_LOW_VOLTHIGH 0x20 SG_SHUTDOWN_VOLTHIGH 0x40 SG_POWER_FAILURE_ENABLE, SG_BATTERY_LOW_ENABLE, and SG_SHUTDOWN_ENABLE indicate whether the signals for a power failure , a low battery condition, and the UPS shutdown are enabled. SG_POWER_FAILURE_VOLTHIGH, SG_BATTERY_LOW_VOLTHIGH, and SG_SHUTDOWN_VOLTHIGH indicate whether the voltage level for these signals are high or low.')
